import './Home.scss';

function Home() {
  return (
    <div className="home">
      <a href="#">click to go to google</a><br/>
      <a href="#">click to go to facebook</a>
      <div className="google" id="google">google</div>
      <div className="google" d="facebook">facebook</div>
    </div>
  )
}

export default Home;
